import React from "react";
import { Text, View, StyleSheet, StatusBar, SafeAreaView, Image } from "react-native";
import Logo from "../components/Logo";
import StartImage from "../components/StartImage";

const HomeScreen = ({ navigation }) => {
  StatusBar.setHidden(true);
  return (
    <View>
      <View style={styles.gapMaker} />
      <Image source={require('../../assets/enjoying.gif')} style={styles.imageStyle} />
      <Logo navigation={navigation} />
      <StartImage navigation={navigation} />
    </View>
  );
};

const styles = StyleSheet.create({
  gapMaker: {
    marginTop: 30,
  },
  imageStyle: {
    height: 70,
    width: 70,
  }
});

export default HomeScreen;
